import React, { useEffect, useState } from "react";
import ObjectCreator from "./ObjectCreator";
import Hero from "./Hero";
import RoadMove from "./RoadMove";
import ObjectCreatorEarth from "./ObjectCreatorEarth";
import ObjectCreatorGrass from "./ObjectCreatorGrass";
import ObjectCreatorBird from "./ObjectCreatorBird";

function AllRoad({ Road }) {
    const [road, setRoad] = useState(Road);

    useEffect(() => {
        const interval = setInterval(() => {
            setRoad((prevRoad) => RoadMove(prevRoad));
        }, 2250);

        return () => {
            clearInterval(interval);
        };
    }, []);

    return (
        <div style={{ display: "flex", flexWrap: "wrap", width: "680px" }}>
            {road.map((objectIndex, index) => {
                let component;

                if (index === 0) {
                    component = <ObjectCreatorBird objectIndex={objectIndex} />;
                } else if (index === 3) {
                    component = <Hero />;
                } else if (index >= 4 && index <= 20) {
                    component = <ObjectCreator objectIndex={objectIndex} />;
                } else if (index >= 21 && index <= 37) {
                    component = <ObjectCreatorGrass objectIndex={objectIndex} />;
                } else if (index >= 38 && index <= 54) {
                    component = <ObjectCreatorEarth objectIndex={objectIndex} />;
                }

                return (
                    <div
                        key={index}
                        style={{
                            width: "40px",
                            height: "40px",
                            border: "1px solid black",
                            boxSizing: "border-box",
                        }}
                    >
                        {component}
                    </div>
                );
            })}
        </div>
    );
}

export default AllRoad;
